import React, { useState } from 'react';
import '../styles/components.css';
import PlaybackControls from './PlaybackControls';
import ItemDetailsModal from './ItemDetailsModal';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';

const initialSections = [
  // Initial sections as in your code
];

const Home = () => {
  const [sections, setSections] = useState(initialSections);
  const [searchQueries, setSearchQueries] = useState({});
  const [itemTags, setItemTags] = useState({});
  const [selectedItem, setSelectedItem] = useState(null);

  const handleSearch = (sectionName, query) => {
    setSearchQueries(prevQueries => ({
      ...prevQueries,
      [sectionName]: query.toLowerCase(),
    }));
  };

  const addTag = (item, tag) => {
    if (!tag) return;
    setItemTags(prevTags => ({
      ...prevTags,
      [item]: prevTags[item] ? [...prevTags[item], tag] : [tag]
    }));
  };

  const handleItemClick = (item) => {
    setSelectedItem(item);
  };

  const closeModal = () => {
    setSelectedItem(null);
  };

  const toggleVisibility = (sectionName) => {
    setSections(prevSections =>
      prevSections.map(section =>
        section.name === sectionName ? { ...section, visible: !section.visible } : section
      )
    );
  };

  // Handle drag-and-drop result
  const onDragEnd = (result) => {
    const { source, destination } = result;
    if (!destination) return;

    const reorderedSections = Array.from(sections);
    const [movedSection] = reorderedSections.splice(source.index, 1);
    reorderedSections.splice(destination.index, 0, movedSection);

    setSections(reorderedSections);
  };

  return (
    <div>
      <h1>Home</h1>

      <PlaybackControls items={sections[0].items} />

      <DragDropContext onDragEnd={onDragEnd}>
        <Droppable droppableId="sections">
          {(provided) => (
            <div
              className="sections"
              {...provided.droppableProps}
              ref={provided.innerRef}
            >
              {sections.map((section, index) => (
                <Draggable key={section.name} draggableId={section.name} index={index}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      className="section"
                    >
                      <h2>
                        {section.displayName}
                        <button onClick={() => toggleVisibility(section.name)} style={{ marginLeft: '10px' }}>
                          {section.visible ? 'Fold' : 'Unfold'}
                        </button>
                      </h2>
                      {section.visible && (
                        <div>
                          <input
                            type="text"
                            placeholder="Search items..."
                            onChange={(e) => handleSearch(section.name, e.target.value)}
                          />
                          <ul>
                            {section.items
                              .filter(item =>
                                searchQueries[section.name]
                                  ? item.name.toLowerCase().includes(searchQueries[section.name])
                                  : true
                              )
                              .map((item, index) => (
                                <li key={index}>
                                  <span
                                    onClick={() => handleItemClick(item)}
                                    style={{ cursor: 'pointer', textDecoration: 'underline' }}
                                  >
                                    {item.name}
                                  </span>
                                  <div className="tags">
                                    {itemTags[item.name]?.map((tag, tagIndex) => (
                                      <span key={tagIndex} className="tag">{tag}</span>
                                    ))}
                                  </div>
                                  <input
                                    type="text"
                                    placeholder="Add a tag"
                                    onKeyDown={(e) => {
                                      if (e.key === 'Enter') {
                                        addTag(item, e.target.value);
                                        e.target.value = ''; // Clear input after adding tag
                                      }
                                    }}
                                  />
                                </li>
                              ))}
                          </ul>
                        </div>
                      )}
                    </div>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </div>
          )}
        </Droppable>
      </DragDropContext>

      <ItemDetailsModal item={selectedItem} onClose={closeModal} />
    </div>
  );
};

export default Home;
